  \"access_constraints\",\n\t\t\"value\": \"[\"Use Constraints: The distributor shall
  not be held liable for improper or incorrect use of this data, based on the description
  of appropriate/inappropriate uses described in this metadata document. It is strongly
  recommended that this data is directly acquired from the distributor and not indirectly
  through other sources which may have changed the data in some way. These data should
  not be used at scales greater than 1:24,000 for the purpose of identifying hydrographic
  watershed boundary feature locations in the U.S.A. The NRCS should be acknowledged
  as the data source in products derived from these data. The Watershed Boundary Dataset
  is public information and may be interpreted by all organizations, agencies, units
  of government, or others based on needs; however, they are responsible for the appropriate
  application of the data. Federal, State, or local regulatory bodies are not to reassign
  to the Natural Resources Conservation Service any authority for the decisions they
  make. The Natural Resources Conservation Service will not perform any evaluations
  of these maps or purposes related solely to State or local regulatory programs.
  Photographic or digital enlargement of these maps to scales greater than that at
  which they were originally delineated can result in misrepresentation of the data.
  If enlarged, the maps will not include the fine detail that would be appropriate
  for mapping at the small scale. Digital data files are periodically updated. Files
